import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";
import "./background.css"
import "./style.css"
import Navbar from "./components/Navbar";
import JumboLanding from "./components/JumboLanding";

function App() {
  return (
    <Router>
      <div>
        <JumboLanding />
        <Navbar />
      </div>
    </Router>
  );
}

export default App;
